def transform_string(n, s, t):
    count = 1
    moves = []
    m = {}
    for c in s:
        if c in m:
            m[c] += 1
        else:
            m[c] = 1
    for c in t:
        if c in m:
            m[c] -= 1
        else:
            m[c] = -1
    for key in m:
        if m[key] != 0:
            return -1
    s = list(s)
    t = list(t)
    for i in range(n):
        if s[i] != t[i]:
            pos = i + s[i:].index(t[i])
            if pos == -1:
                return -1
            for j in range(pos - 1, i - 1, -1):
                (s[j], s[j + 1]) = (s[j + 1], s[j])
                moves.append(j + 1)
    k = len(moves)
    return (k, moves)

